import React from 'react';
import CoffeeHangOut from "../images/hang-out.svg"

function Practice(){
    return (<div>
        <div className="md:grid md:grid-cols-2">
            <div className="flex md:flex-col md:justify-center">
                <h1 className="text-center md:text-left text-6xl">Test</h1>
            </div>
            <img className="w-full h-auto mt-2 " src={CoffeeHangOut} alt="coffee-hang-out" />
        </div>
    </div>)
}

export default Practice;
